import React, { Component } from 'react';
import './CompareCompany.css';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import {Row,Col,Button} from 'react-bootstrap';
import NavWithDropDownUser from '../UserNavBar';

class CompareCompany extends Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <React.Fragment>
                <NavWithDropDownUser />
                <div id="compare-main-div">
                <Container id="card" md="auto">
                <Card className="text-center" id="text-header">
                <Card.Header>{this.props.type}</Card.Header>
                <Card.Body>
                    
                    <Form className="justify-content-center" onSubmit={this.generateMap}>
                        <Form.Group>
                            <Form.Label>User Name</Form.Label>
                            <Form.Control id="name" type="text" placeholder="Enter Username" required />
                        </Form.Group>

                        <Form.Group>
                            <Form.Label>Password</Form.Label>
                            <Form.Control id="password" type="password" placeholder="Password" required />
                        </Form.Group>

                        <Card.Text style={messagestyle}>{this.state.message}</Card.Text> 
                        
                        <Button variant="primary" type="submit">
                            {this.props.type}
                        </Button>
                        
                    </Form>
                       
                </Card.Body>
                <Card.Footer className="text-muted"><span id="footer-text">{this.props.text}</span><Link to={this.props.hlink}> {this.props.hlinktext}</Link></Card.Footer> 
                </Card>
            </Container>
                </div>
            </React.Fragment>
            
        );
    }
}

export default CompareCompany;
